class Submission:
    def __init__(self, title, content):
        self.title = title
        self.content = content
        self.status = 'draft'
        self.is_uploaded = False
        self.is_validated = False
        self.is_published = False

    def upload(self):
        self.is_uploaded = True

    def validate(self):
        required_fields = [self.title, self.content]
        if all(required_fields):
            self.is_validated = True
        else:
            raise ValueError("Validation failed: All required fields must be filled.")

    def publish(self):
        if self.is_uploaded and self.is_validated and not self.is_published:
            self.is_published = True
        else:
            raise ValueError("Publishing failed: Submission must be uploaded, validated, and not already published.")


class UserTestingReport:
    def __init__(self, feedback):
        self.feedback = feedback

    def report_to_agencies(self, agencies):
        for agency in agencies:
            print(f"Reporting to {agency}: {self.feedback}")


