class ErrorLogger:
    def __init__(self):
        self.errors = []

    def log_error(self, submission_id, error_message):
        self.errors.append((submission_id, error_message))

    def get_errors(self):
        return self.errors


class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.submission_ids = set()

    def add_submission(self, submission):
        if submission.title in self.submission_ids:
            raise ValueError("Submission with this title already exists.")
        self.submissions[submission.title] = submission
        self.submission_ids.add(submission.title)

    def delete_submission(self, title):
        if title in self.submissions:
            del self.submissions[title]
            self.submission_ids.remove(title)

    def process_deletions_for_date(self, date):
        # Placeholder for date-based deletion logic
        print(f"Processing deletions for submissions created on {date}.")


